.section-contact{width:100%;height:100%;background-image:url("~assets/contact-background.jpg");background-size:cover;background-repeat:no-repeat
}
.section-contact .container{height:100%;max-width:1200px;width:90%;margin:0 auto;margin-bottom:15px
}
@media only screen and (min-width: 1000px){
.section-contact .container{width:70%
}
}
@media only screen and (min-width: 800px){
.section-contact .container{height:calc(100vh - 64px)
}
}
.section-contact .container h1{font-size:40px;text-align:center;margin:0 0 20px 0;padding-top:10px
}
.section-contact .container h1 span{color:#a24689
}
.section-contact .container .contact-text{padding-bottom:15px
}
.section-contact .container .contact-text p{background:rgba(255,255,255,0.6);padding:5px 5px 8px 10px;border-left:5px solid #a24689;margin:0
}
.section-contact .container .contact-text p:nth-child(even){border-left:5px solid #7893a2
}
@media only screen and (min-width: 800px){
.section-contact .container .contact-text p{margin:20px 20px 0 0
}
}
@media only screen and (min-width: 800px){
.section-contact .container .contact-text{display:inline-block;width:40%;border:none
}
}
.section-contact .container .contact-form{padding:0 0 12px 4px;background:rgba(255,255,255,0.6)
}
@media only screen and (min-width: 800px){
.section-contact .container .contact-form{margin-left:50px;display:inline-block;width:50%;padding:15px 6px 15px 15px
}
}
.section-contact .container .contact-form label{display:block;width:95%;margin:5px
}
.section-contact .container .contact-form label span{font-weight:700;color:#a24689;font-size:20px
}
.section-contact .container .contact-form input{display:block;width:95%;margin:8px;border:none;border-bottom:solid 2px #fcdbf3;padding:5px
}
.section-contact .container .contact-form input[type="submit"]{width:50%;background:#4285f4;border:0;border-radius:2px;-webkit-box-sizing:border-box;box-sizing:border-box;color:#fff;font-size:18px;margin:0 auto;margin-top:10px;padding:10px 24px;font-weight:700
}
.section-contact .container .contact-form input[type="submit"]:hover{-webkit-box-shadow:0px 3px 20px 2px rgba(0,0,0,0.2);box-shadow:0px 3px 20px 2px rgba(0,0,0,0.2);color:#fff;background:rgba(66,133,244,0.8)
}
.section-contact .container .contact-form textarea{display:block;max-width:95%;width:95%;height:80px;margin:5px
}
