header{height:64px;background:#eaeaea;position:relative
}
header .logo{position:absolute;top:50%;-webkit-transform:translate(0, -50%);-ms-transform:translate(0, -50%);transform:translate(0, -50%);left:-5px
}
header .logo img{height:64px
}
header .menu-button{position:absolute;top:50%;right:0;-webkit-transform:translate(0, -50%);-ms-transform:translate(0, -50%);transform:translate(0, -50%);cursor:pointer
}
header .menu-button:hover{text-shadow:0px 0px 20px rgba(0,0,0,0.4)
}
header .menu-button i{font-size:30px;padding:10px;color:#5b5b5b
}
.navigation{position:fixed;top:0;right:0;width:256px;display:block;background:#f4f4f4;height:100vh;overflow:scroll;overflow-x:hidden;-webkit-box-shadow:-4px -4px 20px 0 rgba(0,0,0,0.2);box-shadow:-4px -4px 20px 0 rgba(0,0,0,0.2);-webkit-transition:.5s;-o-transition:.5s;transition:.5s;z-index:50
}
.navigation.off{right:-100%;-webkit-transition:.3s;-o-transition:.3s;transition:.3s
}
.navigation .navigation-content{position:relative;padding-bottom:calc(100vh - 205px)
}
.navigation a{text-decoration:none;color:#212121
}
.navigation .menu-header{position:relative;height:64px;max-height:64px;background-image:url("~assets/menu-background1.png")
}
.navigation .menu-header .close-button{position:absolute;top:50%;-webkit-transform:translate(0, -50%);-ms-transform:translate(0, -50%);transform:translate(0, -50%);left:0;color:#fff;padding:10px;cursor:pointer
}
.navigation .menu-header .close-button:hover{text-shadow:0px 0px 20px #000
}
.navigation .menu-header .close-button i{font-size:30px
}
.navigation .item-more .inside-items{font-weight:400;overflow:hidden;font-size:13px;-webkit-transition:.3s;-o-transition:.3s;transition:.3s
}
.navigation .item-more .inside-items .inside-item{padding:10px 10px 10px 48px
}
.navigation .item-more .inside-items .inside-item:hover{-webkit-box-shadow:inset rgba(0,0,0,0.2) 0px 0px 20px 0px;box-shadow:inset rgba(0,0,0,0.2) 0px 0px 20px 0px
}
.navigation .item-more.run{-webkit-transition:.3s;-o-transition:.3s;transition:.3s
}
.navigation .item-more.run .inside-items{font-size:0
}
.navigation .item-more.run .inside-items .inside-item{padding:0 10px 0 48px
}
.navigation .item{font-weight:700;padding:15px 0 15px 22px;color:#212121;background:#f4f4f4;font-size:13px;cursor:pointer
}
.navigation .item:hover{-webkit-box-shadow:inset rgba(0,0,0,0.2) 0px 0px 20px 0px;box-shadow:inset rgba(0,0,0,0.2) 0px 0px 20px 0px
}
.navigation .item .arrow{float:right;margin:-3px 12px 0 0;-webkit-transform-origin:cener;-ms-transform-origin:cener;transform-origin:cener;-webkit-transform:rotate(0deg);-ms-transform:rotate(0deg);transform:rotate(0deg)
}
.navigation .item .arrow.run i{-webkit-transform:rotate(180deg);-ms-transform:rotate(180deg);transform:rotate(180deg);-webkit-transition:.3s;-o-transition:.3s;transition:.3s
}
.navigation .bottom-menus{position:absolute;bottom:5px
}
.navigation .bottom-menus .social{text-align:center;width:256px
}
.navigation .bottom-menus .social .item-social{display:inline-block;cursor:pointer;padding:10px
}
.navigation .bottom-menus .social .item-social:hover{-webkit-box-shadow:inset rgba(0,0,0,0.2) 0px 0px 20px 0px;box-shadow:inset rgba(0,0,0,0.2) 0px 0px 20px 0px
}
.navigation .bottom-menus .social .item-social img{width:20px
}
.navigation .bottom-menus .legal{text-align:center;width:256px;font-size:10px;color:#616161
}
html{font-family:"Source Sans Pro", -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;font-size:16px;word-spacing:1px;-ms-text-size-adjust:100%;-webkit-text-size-adjust:100%;-moz-osx-font-smoothing:grayscale;-webkit-font-smoothing:antialiased;-webkit-box-sizing:border-box;box-sizing:border-box
}
.background.run{position:fixed;width:100vw;height:100vh;top:0;left:0;bottom:0;right:0;background:rgba(0,0,0,0.4);-webkit-transition:.5s;-o-transition:.5s;transition:.5s;z-index:20
}
body{background-color:#F7F6EF
}
body.run{overflow:hidden
}
*,*:before,*:after{-webkit-box-sizing:border-box;box-sizing:border-box;margin:0
}
@-webkit-keyframes rotate{
0%{-webkit-transform:rotate(180deg);transform:rotate(180deg)
}
100%{-webkit-transform:rotate(0deg);transform:rotate(0deg)
}
}
@keyframes rotate{
0%{-webkit-transform:rotate(180deg);transform:rotate(180deg)
}
100%{-webkit-transform:rotate(0deg);transform:rotate(0deg)
}
}
