    position: relative;
    height: calc(100vh - 128px);
    .image {
        min-width: 100%;
        transition: .3s;
        height: calc(100vh - 128px);
        @media only screen and (min-width: 800px) {
            height: calc(100vh - 64px);
        }
        img {
            width: 250%;
            height: 100%;
            max-height: 1080px;
            max-width: 1920px;
            transition: .2s;
            @media only screen and (min-width: 500px) {
                width: 170%;
            }
            @media only screen and (min-width: 700px) {
                width: 120%;
            }
            @media only screen and (min-width: 900px) {
                width: 100%;
            }
        }
    }
    .content {
        position: absolute;
        font-size: 20px;
        color: #fff;
        right: 0;
        top: 0;
        height: 100%;
        max-width: 30%;
        background: rgba(0, 0, 0, 0.35);
        padding: 20px 10px 35px 10px;
        @media only screen and (max-width: 800px) {
            height: inherit;
            max-width: 100%;
            width: 100%;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
        }
        h2 {
            margin: 0 0 30px;
        }
        p {
            text-align: left;
        }
        a {
            text-decoration: none;
            color: #fff;
            font-size: 23px;
        }
        .link {
            position: absolute;
            text-align: center;
            bottom: 84px;
            width: 75%;
            //border-radius: 5px;
            background: rgba(0, 0, 0, 0.35);
            border: none;
            padding: 6px 0 10px 0;
            left: 50%;
            transform: translate(-50%, -50%);
            @media only screen and (max-width: 800px){
              bottom: 20px;
            }
            &:hover {
                transition: .4s;
                background: rgba(0, 0, 0, 0.6);
            }
            .arrow {
                float: right;
                display: inline;
                margin-right: 10px;
                i {
                    vertical-align: -0.25em;
                }
            }
        }
    }
}

.controls {
    height: calc(100vh - (100vh - 64px));
    background: #eaeaea;
    transition: .3s;
    @media only screen and (min-width: 800px) {
        position: absolute;
        bottom: 10px;
        right: 0;
        box-shadow: rgba(0, 0, 0, 0.15) -2px -2px 20px 4px;
        z-index: 1;
    }
    .arrow {
        display: inline;
        padding: 18px 15px;
        float: right;
        cursor: pointer;
        transition: .4s;
        &:first-child {
            margin-left: 5px;
            @media only screen and (min-width: 800px) {
                margin-left: 30px;
            }
        }
    }
}

@media only screen and (min-width: 800px) {
    .controls .arrow:hover {
        background: #d1d1d1;
    }
}

.swiper-container {
    z-index: 0;
}

.swiper-pagination .swiper-pagination-bullets li,
.swiper-pagination-bullet-active {
    background: red;
}

.my-swiper {
    height: 300px;
    width: 100%;
    .swiper-slide {
        text-align: center;
        font-size: 38px;
        font-weight: 700;
        background-color: #eee;
        display: flex;
        justify-content: center;
        align-items: center;
    }
    .swiper-pagination-custom .swiper-pagination-bullet {
        width: 8px;
        height: 8px;
        display: inline-block;
        border-radius: 100%;
        background: #000;
        opacity: 0.2;
    }
}
"],"sourceRoot":""}]);

